import React from 'react';

import { StyledIdentification, Description, Form, Text } from './styles';


const Identification = () => {
  return (

    <StyledIdentification>

      <Description>
        <Text>For you playing game,
        first identify yourself! :)</Text>
      </Description>
      <Form>
        <p> Name</p>
        <input placeholder='Type your name' />
      </Form>

    </StyledIdentification>
  );
};



export default Identification;
